import React from "react";

const TaskCard = (props: any) => {
  return (
    <div>
      <h2>{props.title}</h2>
      <span>{props.data}</span>
      <span>{props.time}</span>
      <p>{props.person}</p>
    </div>
  )
}

export default TaskCard;
